import "./Menu.css";

class Menu extends Component {
  constructor(props){
    super(pr)
  }
  render() {
    var visibility = "hide";

    if (this.props.menuVisibility) {
        console.log("hai");
      visibility = "show";
    }

    return (
      <div id="flyoutMenu"
           onMouseDown={this.props.handleMouseDown} 
           className={visibility}>
        <h2>Home</h2>
        <h2>About</h2>
        <h2>Contact</h2>
        <h2>Search</h2>
      </div>
    );
  }
}

export default Menu;
